import React, {useEffect} from "react";
import { useHistory } from "react-router-dom";
import { FiArrowLeft, FiPlus } from "react-icons/fi";

import loginImg from '../images/login2.png';
import api from '../services/api';

import '../styles/pages/login.css';
import { useState } from "react";


function Login() {
    const [logins, setLogins] = useState([]);
    console.log(logins);
    useEffect(()=> {
      api.get('logins').then(response => {setLogins(response.data);})
    }
    );
    const { goBack } = useHistory();

    return (
        <div id="page-login">
            <aside>
               <header>
                   <img src={loginImg} alt="login" />
                   <h2>Efetuar login no sistema</h2>
                   <p>Sua saúde em primeiro lugar :)</p>
               </header> 
               <footer>
                    <strong>Direito de cópia</strong>
                    <span>SSA Sistemas</span>
                      <button type="button" onClick={goBack}>
                        <FiArrowLeft size={24} color="#FFF" />
                      </button>
               </footer>
            </aside>
            <main>
                <form className="create-login-form">
                    <div className="input-block">
                      <label htmlFor="name">Email</label>
                      <input id="email" />
                    </div>
                    <div className="input-block">
                      <label htmlFor="name">Senha</label>
                      <input id="senha" />
                    </div>
                    <button className="confirm-button" type="submit">
                            Confirmar
                    </button>

                </form>
            </main>

        </div>
    )
}

export default Login;
